import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
// import Newsitem from './components/Newsitem';
import News from './components/News';
import { BrowserRouter as Router,
  Switch,

} from "react-router-dom";

function App() {

  return (

<>
<div>
  <Router>
 <Navbar/>
 <Switch>
 <Route exact path="/Home"><News pageSize={5} category="Home"/></Route>
 <Route exact path="/business"><News pageSize={5} category="business"/></Route>
 <Route exact path="/crime"><News pageSize={5} category="crime "/></Route>
 <Route exact path="/entertainment"><News pageSize={5} category="entertainment"/></Route>
 <Route exact path="/environment"><News pageSize={5} category="environment"/></Route>
 <Route exact path="/health"><News pageSize={5} category="health"/></Route>
 <Route exact path="/lifestyle"><News pageSize={5} category="lifestyle"/></Route>
 <Route exact path="/science"><News pageSize={5} category="science"/></Route>
 <Route exact path="/technology"><News pageSize={5} category="technology"/></Route>
 <Route exact path="/politics"><News pageSize={5} category="politics"/></Route>
 <Route exact path="/sports"><News pageSize={5} category="sports"/></Route>
 </Switch>
 </Router>
</div>
</>


  );
}

export default App
